import React from 'react';
import { bool, func } from 'prop-types';
import {HamburgerIcon, HamburgerContainer} from './HamburgerElements';

const Hamburger = ({ isOpen, setOpen }) => {
    return (
      <HamburgerContainer isOpen={isOpen} setOpen={setOpen}>
        <HamburgerIcon onClick={setOpen}>
          <div />
          <div />
          <div />
        </HamburgerIcon>
      </HamburgerContainer>
    )
};
export default Hamburger;
